      | 30042 -> { ItemTypeData.id= 30042; name= "OLD Legion Electronics - Emergent Locus Analyzer"; published= false; description= "This subsystem is obsolete and has been replaced by newer technology    Emboldened by the development of other, more specialized subsystems, engineers and astrophysicists alike began to investigate modifications to a Strategic Cruiser that could aid their fellow scientists and explorers. The first reverse-engineering projects were predominantly focused on ways to improve a vessel's astrometrics capabilities. The two-pronged solution of boosting both the strength of the launchers and the probes they deployed proved to be the most popular design in the end. It was not long after the first designs were sold that others took notice and began to reverse-engineer their own. Soon enough, the subsystem was catapulted into mainstream Tech III subsystem manufacture, although perhaps for more than just that one reason.      The first designers of the emergent locus analyzer noted an additional – and entirely unintended – effect in tractor beams. Not only did they reach further, but they would also pull in their cargo more quickly than normal tractor beams. It was an unexpected by-product of the processes that increased scan probe strength, but far from an undesirable one. Although it is not fully clear what part of the construction process enables this additional benefit, so long as the subsystem is built in that exact fashion, it will continue to provide it.      Subsystem Skill Bonus:  10% increase to scan strength of probes per level.  20% bonus to range and velocity of tractor beams per level.    Role Bonus:  -99% reduced CPU need for Scan Probe Launchers.  +10 Virus Strength to Relic and Data Analyzers."; marketGroupId= None; groupId= 955; dogmaAttributes= [| { DogmaAttributeValueData.attributeId = 4; value= 1200000.000000 }; { DogmaAttributeValueData.attributeId = 2696; value= 1.000000 }; { DogmaAttributeValueData.attributeId = 9; value= 40