      | 4337 -> { ItemTypeData.id= 4337; name= "Research Abstract: Project Huntress Green (3 of 3)"; published= true; description= "<b>Paper:</b> Huntress Green - Possible disease organisms in Anoikis<br>  <b>Lead Researcher:</b> Gaia Ma'chello<br>  <b>Contributors:</b> James Arget, Tas Caern and Vincent Athena<br>  <b>Summary:</b> Examination of multiple biological samples obtained from planets in the unknown regions has found several organisms that could cause diseases in humans. The most interesting one is a certain fungus found on several temperate worlds.    This fungus appears able to colonize almost any surface or other organism. As it digests another organism, some proteins from that organism are displayed on the surface of the fungal strands. This allows the fungus to evade the immune system of many infected hosts.    Some bacteria were also found that appear to be somewhat infectious. They do not appear to be too virulent, but some of the chemicals they produce are of particular interest. These chemicals have neurological effects that alter the behavior of the host, helping spread the bacteria.    <i>This abstract relates to research undertaken by the <a href=evebrowser: http://wiki.eveonline.com/en/wiki/Arek%27Jaalan>Arek'Jaalan Project.</a></i>    <i>Authorized for capsuleer dissemination under the CONCORD Freedom of Distribution Act (Alpha-One-Five), YC 113.11.4</i>    <i>Further copies of this document can be obtained through the Arek'Jaalan administrative site, located in the <a href=showinfo:5//30003413>Eram</a> system.<i>"; marketGroupId= None; groupId= 1141; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 1.000000; packagedVolume= 0.100000; portionSize= 1; radius= 1.000000; volume= 0.100000 } |> Some
