      | 44204 -> { ItemTypeData.id= 44204; name= "300 Aurum Token"; published= true; description= "This item can be redeemed for 300 Aurum (AUR).<br><br><font color= yellow >To Redeem:</font> Right-click the Aurum Token and select  Redeem for AUR .<br><br><font color= yellow >On the Aurum Token:</font> Originally designed for Noble Appliances in YC 113, the aurum token is a physical chit that can be redeemed for a predefined amount of AUR currency.<br><br>Though at first blush it appears to be a large coin, the aurum token shares more in common with high-security datacores. At the center of the token is digital ID paired with a series of suspended entangled electrons. When the token is redeemed, the entangled electrons are engaged, altering their partners located at an off-site bank. Not only does this ensure the exchange occurs instantly, but when combined with a proprietary security shell it renders attempts to tamper or counterfeit the token useless.<br><br>Though the gold and silver case is merely an aesthetic addition, the coin-like appearance has become synonymous with the device, leading to nicknames of  gold aurum , or  golden token .<br><i>Source: SCOPE fluff piece (unprinted)</i>"; marketGroupId= Some(1427); groupId= 943; dogmaAttributes= [| { DogmaAttributeValueData.attributeId = 161; value= 0.010000 }; { DogmaAttributeValueData.attributeId = 162; value= 1.000000 }; { DogmaAttributeValueData.attributeId = 4; value= 0.000000 }; { DogmaAttributeValueData.attributeId = 1818; value= 300.000000 }; { DogmaAttributeValueData.attributeId = 38; value= 0.000000 } |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
